          }}
        />
        <Stack.Screen
          name="Origin"
          component={Origin}
          options={{
            title: 'Ursprung des Apps'
          }}
        />
        <Stack.Screen
          name="Home"
          component={HomeTabs}
          options={({ route }) => ({
            headerTitle: getHeaderTitle(route),
          })}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

